import React from 'react';
import { HiBell } from 'react-icons/hi'

const Header = () => {
  return (
    <div className='absolute w-[75vw] h-[12vh] left-[15vw] border-b'>
      <div className='flex flex-row items-center p-0 gap-[20px] absolute right-1'>
        <HiBell  className='w-[25px] h-[25px] text-[#DB8888]'/>
        <div className='bg-slate-500 rounded-full w-[40px] h-[40px]'></div>
      </div>
    </div>
  )
}

export default Header
